import React from 'react';
import About from './About';
const Header = () => {
  return (
    <header>
    <div>
     <ul><li><Link to="/About" className="nav-link">About</Link></li><li>Create</li><li>See Characters</li></ul>
      </div>
    </header>
  );
};

export default Header;
